                             <p><strong>Towards this the specific KRAs (Key Result Areas) for the Placement Committee are 3 fold as under:</strong></p>

                             <p>Towards this the specific KRAs (Key Result Areas) for the Placement Committee are 3 fold as under:<br /><br />1. Initiating series of ON campus and OFF campus recruitments, and making arrangements with corporate organizations for placement of our various students in the areas of Engineering. <br />2. Placement of students in different companies for summer internship in the fourth and sixth semester. <br />3. To prepare students in keeping with the changing requirements of business and industry visits to be arranged with good organizations. For the furtherance of this objective guest lectures also to be arranged every month by senior executives/professionals.<br /><br />The industry has in the past eagerly sought the intellectual capital of KEC by participating in the final placement process. This year has been no exception as prestigious companies made a beeline for our campus to recruit the best of talent. Truly the ready absorption of our graduates by the industry speaks volumes of not only the excellence of our academic programs but also of the top quality of our highly trained and groomed students.<br /><br />Each year our placement process starts with characteristic zeal and gusto. Our enterprising and proactive placement cell which is engaged in organising seminars, guest lectures, conferences, industry visits, summer placements and other corporate events throughout the year begins inviting top corporate for final placement from September onwards.<br /><br />This year we have accomplished excellent placements. Our Students have been placed in most prestigious companies such as TCS, HCL Technologies , HP, Cognizant, IBM, R Systems, etc .</p>
                           </div>
                           
