    <br>
    <div align="justify">
    <strong>Placement Policies</strong>
    <p>1. The college will strive to offer at least one chance to every eligible student from 6th semester to appear in a placement interview/exam. The general eligibility conditions are:<br /><br />Consistent performance from class X to 5th sem. (aggregate above 60%, no backs dead or live)<br />Consistent attendance upto &amp; including 5th semester. (&gt;75%, relaxable in special cases to 60% on merit). Students to produce attendance ok certificate from HoD to placement cell.<br />Students having less than 75% attendance in any of the semester will be put up for placement as per following criteria.<br />Less than 75% attendance in any one semester – Not eligible for 1st two interviews.<br />Less than 75% in two semesters – Not eligible in first 5 interviews.<br />Less than 75% more than two semesters – Not eligible for any interviews.<br />2. Performance standards (a) above may be relaxed or made more stringent by companies. For each company interview, the performance criteria will be put up.  Students have to meet these requirements.<br /><br />3. Other aspects of placement policy are as follows :<br /><br />Recommendation of students put up for interviews/exams is governed by following :<br />Equitable opportunity is provided to all eligible students.<br />If number of students accepted by company for interview is restricted, recommendation to appear for interview will be based on aggregate Marks (total).  If aggregate marks are equal than aggregate attendance will be given weightage.<br />Students who do not get selected in one or more interview will be given further chance provided no fresh student not having at least a chance is above him.<br />For students involved in disciplinary cases, Director has the discretion to stop them form appearing in any interview.<br />Final year students selected for IT related jobs by tier I companies will be given one more chance to appear for their core branch related interview (for eg. an ME student selected for WIPRO can appear for Mahindra &amp; Mahindra Mechanical Branch job interview.)<br />4. It may be noted that most of the companies have indicated that the Director is to certify that selected students (in VII Sem) has maintained their academic standards till VIII Sem and are not involved in any serious discipline related cases. They also need a good conduct/character certificate from college for selected students.<br /><br />5. Students are therefore urged to work towards Placement preparations, in earnest right from IInd yr onwards and acquire skills required during placement interviews through courses offered by college or arranged in college campus through outsourcing.</p></div><br><br>


